import React from 'react';
import Auxi from '../Auxi/Auxi';
const layout =(props)=>{
    return(
        <Auxi>
            <div>logo search notification</div>
            <div>navbar</div>
            <div>nav title</div>
            <main>
                main
            </main>
            <div>footer</div>
        </Auxi>
    );
}
export default layout;
